mstrWeb.1651=Att definiera en ny kanal betyder att du väljer en mapp från ett antal befintliga tjänster inom Narrowcast-lagringsplatsen, tilldelar kanalen ett namn och en beskrivning och publicerar kanalen till prenumerationsportalen.
