mstrWeb.1655=Det finns en kryssruta för att ange om den här kanalen och dess egenskaper kommer att vara tillgänglig för slutanvändarna.
mstrWeb.1656=Namn och beskrivning på kanalen
mstrWeb.1657=En enhet är ett specifikt hjälpmedel för leverans av prenumerationsinnehåll till slutanvändaren.  Varje adress som användaren skapar i portalen  är avsedd att använda endast en enhet, t.ex. Outlook 98 eller Outlook 2000.
mstrWeb.1658=Enhetstypen är en grupp av enheter för vilka användaren väljer för att bestämma hur de kommer att ta emot innehållet. När en ny webbplatsdefinition skapas, skapas och konfigureras fyra standardenhetstyper automatiskt.
mstrWeb.1659=Typerna är:
mstrWeb.1660=Digitala sekreterare
mstrWeb.1661=Mobiltelefoner
mstrWeb.1662=Personsökare
mstrWeb.1663=E-post
mstrWeb.1664=Dessa standardenheter skapas när portaldesignern i MicroStrategy Narrowcast installeras och mapparna, som är kopplade till dessa enheter, lagras i Narrowcast-repositoryn.
mstrWeb.1665=Från den här guiden har du följande alternativ:
mstrWeb.1666=ändra namn på en specifik enhetstyp
mstrWeb.1667=modifiera definitionen för en enhetstyp
mstrWeb.1668=radera en enhetstyp ///för att stödjas av portalen///
mstrWeb.1669=redigera enhetstypens mapp
mstrWeb.1670=skapa en ny enhetstyp
mstrWeb.1671=För varje ny definition av enhetstyp måste du ange enhetstypens namn, den stora och lilla ikonens URL, adressformatet och vilka fält som kommer att användas vid visning och redigering.
mstrWeb.1672=Använd den här skärmen när du ska lägga till eller ta bort element från mappen för denna specifika enhetstyp.
mstrWeb.1673=För den här enhetstypen är elementen till vänster tillgängliga, men inte aktiva.  Elementen till höger är för närvarande valda för den här specifika enhetstypen.
mstrWeb.1674=I detta sammanhang är en enhet ett specifikt sätt att leverera innehåll till slutanvändaren.  Standardalternativen ///som erbjuds/// är "generisk e-postklient" och "portalenhet."  Du kan ändra standardalternativen efter behov.
mstrWeb.1675=Klicka på lämplig enhet om du vill ändra urvalet.
mstrWeb.1676=För varje informationskälla måste du ange om användaren måste ange sin autentiseringsinformation, t ex användarnamn och lösenord.
mstrWeb.1677=Om projekträttigheterna används, hoppas autentifieringsmekanismen över och användaren kommer att föras över till den information han/hon har begärt.
mstrWeb.1678=Det finns även alternativ där användarrättigheter krävs eller där dessa är valfria.
mstrWeb.1679=Som standard tillåts inte användaren att ange någon autentifiering för någon informationskälla.
mstrWeb.1680=Du måste ändra kravet om du önskar att autentifiering ska gälla.
mstrWeb.1681=Välj inställningar för återstoden av webbplatsens egenskaper.
mstrWeb.1682=Webbplatsinställningarna styr hur standardvärdena anges för användare av portalgränssnittet.  Du kan ändra alla inställningarna genom att modifiera informationen som visas på den här sidan.
