mstrWeb.10784=Vad är MicroStrategy Express
mstrWeb.10785=Med MicroStrategy Express får du åtkomst till dina data direkt och säkert. Skapa snygga instrumentpaneler och dela dina insikter med kollegor och vänner. Leverera anpassade data till tusentals mottagare automatiskt. Utforma mobilgränssnitt för en fantastisk användarupplevelse. Det krävs ingen särskild utbildning eller IT-support.
mstrWeb.10786=Välj data
mstrWeb.10787=Se hur du får åtkomst till dina data direkt och säkert med Express.
mstrWeb.10788=Förbered dina data för analys med Express. Ingen komplicerad kodning eller datamodellering krävs.
mstrWeb.10789=Granska data
mstrWeb.10790=Använd Express för uppdatering av data i dina befintliga instrumentpaneler snabbt och enkelt, utan att behöva skapa om dem.
mstrWeb.10791=Skapa instrumentpanel, del 1
mstrWeb.10792=Se hur du kan skapa snygga och interaktiva instrumentpaneler och lära dig olika delar av gränssnittet där du skapar instrumentpaneler i Express.
mstrWeb.10793=Skapa instrumentpanel, del 2
mstrWeb.10794=Få insikt om dina data med de praktiska redigeringsverktygen i Express: justera kategorier och serier, flytta och ändra storlek på visualiseringar, infoga text, lägg till paneler och layouter, använd filter, borra ned i data, skapa nya beräkningar i farten, justera sifferformat, använd färger för definition av trösklar med mera.
mstrWeb.10795=Värme-/trädkarta
mstrWeb.10796=Använd värmekartor (kallas även trädkartor) för att förstå och jämföra stora mängder med värden på en gång med hjälp av en kombination färgade rektanglar organiserade i grupper.
mstrWeb.10797=Linje- och stapeldiagram
mstrWeb.10798=Upptäck trender och avskilda delar i diagram över dina data med linjer och staplar i Express.
mstrWeb.10799=Bubbel- och punktdiagram
mstrWeb.10800=Med bubbel- och punktdiagrammen i Express kan du jämföra data över flera variabler samtidigt.
mstrWeb.10801=Tabelldiagram
mstrWeb.10802=Använd tabell- och diagramvisualiseringen i Express för att identifiera trender över kombinationer med data.
mstrWeb.10803=Nätverksdiagram
mstrWeb.10804=Nätverksdiagram är ett praktiskt sätt att visa element i en grupp och visualisera relationen mellan dem.
mstrWeb.10805=Social delning
mstrWeb.10806=Social delning finns tillgängligt under området Personligt i Express. Dela personliga insikter med vänner på nätet, i bloggar och sociala medier.
mstrWeb.10807=Använda iPad
mstrWeb.10808=Se hur du får åtkomst till och använder Express i farten med din iPad, snabbt och enkelt! Prova själv!
mstrWeb.10809=Använd avancerade mallar för att skapa proffsiga rapporter och instrumentpaneler för ledningsmöten med pixel-perfekta designfunktioner.
mstrWeb.10810=Använd anpassningar och visa dina kollegor olika delar av samma instrumentpanel beroende på deras användarprofil och säkerhetsinformation.
mstrWeb.10811=Schemalägg automatiska leveranser av dina instrumentpansler till medlemmar i ett Express-team eller tusentals kunder på olika adresser.
mstrWeb.10812=Teamstartskärmar är anpassade startsidor där du får kontakt med ditt team. Anpassa utseendet och funktionerna på din startsida och publicera dina användares favoritinstrumentpaneler och dokument för direktåtkomst.
mstrWeb.10813=Express ger snabba och bekväma analysfunktioner. Detta hjälper affärsanvändare att få åtkomst till data direkt, lokalt eller i molnet, och utforska dem med intuitiva datavisualiseringar. Utforma mobilgränssnitt, skapa interaktiva instrumentpaneler och leverera anpassade data till tusentals personer.
