mstrWeb.10878=Granska data. Om dina kalkylbladsdata är organiserade i korstabuleringsformat får du hjälp av Express att omvandla data till tabellformat (vanlig eller avnormaliserad tabell med en rad för sidhuvuden) så att du kan identifiera vilka kolumner som ska vara attribut och vilka som ska vara måttenheter.
mstrWeb.10879=Välj alternativet 'Korstabulerade'
mstrWeb.10880=Dra i kanterna på det ljusorangea området för att identifiera måttenheterna. Måttenheter är värden som används för beräkningar (kostnad, intäkt, antal, procent osv.)
